import React from 'react';
import classes from "../Footer/Footer.module.css"
const Footer = () => {
    return (
        <div>
            <div className={classes.footer}>&copy; ООО "Шторм Вульвс", 2023. Все права защищены.</div>
        </div>
    );
};

export default Footer;
